import React, { useState } from "react";
import { Box, Grommet, CheckBox } from "grommet";

function Todotest() {
  const [checked, setChecked] = useState(true);
  return (
    <Grommet>
      <CheckBox
        checked={checked}
        label="interested?"
        onChange={(event) => setChecked(event.target.checked)}
      />
    </Grommet>
  );
}

export default Todotest;
